    t.FullName,
    s.SemesterName,
    s1.SchoolYearName,
    m.CreatedDate,
    m.ModifiedDate
  FROM moduleclass m
    LEFT JOIN module m1
      ON m.ModuleID = m1.ModuleID
    LEFT JOIN teacher t
      ON m.TeacherID = t.TeacherID
    LEFT JOIN semester s
      ON m.SemesterID = s.SemesterID
    LEFT JOIN schoolyear s1
      ON m.SchoolYearID = s1.SchoolYearID
  WHERE m.ModuleClassID = moduleclassId;
