--
-- Create procedure `Proc_InsertDetailModuleClass`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_InsertDetailModuleClass (IN ModuleClassID char(36), IN StudentID char(36), IN FrequentPoints1 float, IN FrequentPoints2 float, IN MediumScore float, IN StudentCode varchar(255), IN ModuleClassCode varchar(255))
BEGIN
  DECLARE IDstudent char(36);
  DECLARE IDmoduleclass char(36);
  IF (StudentCode IS NOT NULL
    AND ModuleClassCode IS NOT NULL) THEN
    SET IDstudent = (SELECT
        s.StudentID
      FROM student s
      WHERE s.StudentCode = StudentCode);
    SET IDmoduleclass = (SELECT
        m.ModuleClassID
      FROM moduleclass m
      WHERE m.ModuleClassCode = ModuleClassCode);
    INSERT detailmoduleclass (DetailModuleClassID, ModuleClassID, StudentID, FrequentPoints1, FrequentPoints2, MediumScore, CreatedDate, ModifiedDate)
      VALUES (UUID(), IDmoduleclass, IDstudent, FrequentPoints1, FrequentPoints2, MediumScore, NOW(), NOW());
  ELSEIF (StudentCode IS NULL
    AND ModuleClassCode IS NULL) THEN
    INSERT detailmoduleclass (DetailModuleClassID, ModuleClassID, StudentID, FrequentPoints1, FrequentPoints2, MediumScore, CreatedDate, ModifiedDate)
      VALUES (UUID(), ModuleClassID, StudentID, FrequentPoints1, FrequentPoints2, MediumScore, NOW(), NOW());
  END IF;
END
$$

