    d.FrequentPoints2,
    d.MediumScore,
    d.CreatedDate,
    d.ModifiedDate,
    s.StudentCode,
    s.FullName,
    s.ClassID,
    c.ClassName,
    c.CourseID,
    c.MajorsID,
    c1.CourseName,
    m1.MajorsName
  FROM detailmoduleclass d
    LEFT JOIN moduleclass m
      ON d.ModuleClassID = m.ModuleClassID
    LEFT JOIN student s
      ON d.StudentID = s.StudentID
    LEFT JOIN class c
      ON s.ClassID = c.ClassID
    LEFT JOIN majors m1
      ON c.MajorsID = m1.MajorsID
    LEFT JOIN course c1
      ON c.CourseID = c1.CourseID
  WHERE d.DetailModuleClassID = DetailModuleClassID;
END
